  refuge highlights and various accomplishments for the 1973 fiscal year. Accomplishments
  described include Demonstrations, wildlife interpretive programs, environmental
  education, professional services rendered, migratory bird hunting general, warm
  water fishing, wildlife observation, wildlands appreciation. photography, public
  affairs, picnicking, swimming, boating, water skiing, ecological monitoring, other
  programs, threatened species, special recognition species, waterfowl maintenance,
  waterfowl production, species transplanted, haying, and grazing.\",\n\t\"owner_org\":
